import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import './index.css'
import Sdata from './Sdata'

console.log(Sdata[0].sname);

  ReactDOM.render( 
  <>

  <h1 className="heading_style"> List of top 5 netflix series in 2020 </h1>

      <Card imgsrc= {Sdata[0].imgscr}
        title={Sdata[0].title}
        sname = {Sdata[0].sname}
        link = {Sdata[0].links}/>
         <Card imgsrc= {Sdata[1].imgscr}
        title={Sdata[1].title}
        sname = {Sdata[1].sname}
        link = {Sdata[1].links}/>
         <Card imgsrc= {Sdata[2].imgscr}
        title={Sdata[2].title}
        sname = {Sdata[2].sname}
        link = {Sdata[2].links}/>
         <Card imgsrc= {Sdata[1].imgscr}
        title={Sdata[1].title}
        sname = {Sdata[1].sname}
        link = {Sdata[1].links}/>
         <Card imgsrc= {Sdata[1].imgscr}
        title={Sdata[1].title}
        sname = {Sdata[1].sname}
        link = {Sdata[1].links}/>
        </>,

  document.getElementById('root')
  );
